import React, { useState } from 'react';
import { useCookies } from 'react-cookie';
import { Modal, Button, Form } from 'react-bootstrap';
import APIService from './APIService';
import '../App.css'; // Import your CSS file for custom styles

function NavBar() {
  const [token, setToken, removeToken] = useCookies(['mytoken']);
  const [showModal, setShowModal] = useState(false);
  const [isLogin, setIsLogin] = useState(true);
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const logoutBtn = () => {
    removeToken(['mytoken']);
  };

  const handleClose = () => setShowModal(false);
  const handleShow = () => setShowModal(true);

  const loginBtn = () => {
    if (username.trim().length !== 0 && password.trim().length !== 0) {
      APIService.LoginUser({ username, password })
        .then((resp) => {
          setToken('mytoken', resp.token);
          handleClose();
        })
        .catch((error) => console.log(error));
    } else {
      console.log('Username and password are not set');
    }
  };

  const registerBtn = () => {
    if (username.trim().length !== 0 && password.trim().length !== 0) {
      APIService.RegisterUser({ username, password })
        .then(() => loginBtn())
        .catch((error) => console.log(error));
    } else {
      console.log('Username and password are not set');
    }
  };

  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <div className="container-fluid">
          <a className="navbar-brand" href="/">Learn Python Blog</a>
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNav">
            <ul className="navbar-nav ms-auto">
              {token['mytoken'] ? (
                <li className="nav-item">
                  <button className="nav-link btn btn-link" onClick={logoutBtn}>Log out</button>
                </li>
              ) : (
                <li className="nav-item">
                  <button className="nav-link btn btn-link" onClick={handleShow}>Login/Register</button>
                </li>
              )}
            </ul>
          </div>
        </div>
      </nav>

      {/* Modal for Login/Register */}
      <Modal show={showModal} onHide={handleClose} centered>
        <Modal.Header closeButton>
          <Modal.Title>{isLogin ? 'Login' : 'Register'}</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <Form>
            <Form.Group className="mb-3" controlId="username">
              <Form.Label>Username</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter username"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
              />
            </Form.Group>
            <Form.Group className="mb-3" controlId="password">
              <Form.Label>Password</Form.Label>
              <Form.Control
                type="password"
                placeholder="Enter password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
            </Form.Group>
          </Form>
        </Modal.Body>
        <Modal.Footer>
          {isLogin ? (
            <>
              <Button variant="primary" onClick={loginBtn}>Login</Button>
              <p>Don't have an account? <Button variant="link" onClick={() => setIsLogin(false)}>Register</Button></p>
            </>
          ) : (
            <>
              <Button variant="primary" onClick={registerBtn}>Register</Button>
              <p>Already have an account? <Button variant="link" onClick={() => setIsLogin(true)}>Login</Button></p>
            </>
          )}
        </Modal.Footer>
      </Modal>
    </div>
  );
}

export default NavBar;
